import React, { Component } from 'react';


export class MessageComponent extends Component {
  render() {
    return(
    <div>
        <img src={require('./avatar.jpg')} alt='neki tekst'/>
        <p>This is an Employee Management System</p>
    </div>
    )
  }
}
export default MessageComponent;
